import React from 'react';


class FrontPage extends React.Component{
  constructor(props){
    super(props)
    this.state={
      newsFeeds:[]
    }
  }

  componentWillMount(){
    this.fetchData();
  }

  fetchData(){
    const url ="https://hacker-news.firebaseio.com/v0/topstories.json"
      return fetch(url)
              .then(res=>res.json())
              .then(data => this.setState({newsFeeds:data}))
              .catch(error=>error)
              
  }

  render(){
    return(
      <div>
        {this.props.newsFeeds}
      </div>
    ) 
  }
}




export default FrontPage;
